import React, { useEffect } from 'react'
import AdminRegistration from '../components/admin/AdminRegistration'
import { connect } from 'react-redux'
import { getAllSupportTasks, editSupportTasks } from '../redux/actions/adminActions'
import TasksList from '../components/admin/TasksList'

function Admin({ tasks, getAllSupportTasks, editSupportTasks }) {

  useEffect(() => {
    getAllSupportTasks();
  }, []);

  return (
    <div>
      <AdminRegistration />
      <TasksList tasks={tasks} editSupportTasks={editSupportTasks} />
    </div>
  )
}

const mapStateToProps = state => {
  return {
    tasks: state.admin.tasks
  }
}

const mapDispatchToProps = {
  getAllSupportTasks, editSupportTasks
}

export default connect(mapStateToProps, mapDispatchToProps)(Admin);
